import React from "react";
import {Paper,Grid,withStyles} from "@material-ui/core";

const Weather=(data)=>{

    return (
        <Grid xs={12}>
            <span>Today's Weather</span>
            <Grid item xs>
                <img src={"http:"+data.condition.icon}/>
                <span>{data.condition.text}</span>
            </Grid>
        </Grid>
    );
}

export default Weather;
